import dataM from '../data/gogungCategory.json';
import dataD from '../data/gogungListOpenApi.json';
import Gblock from './Gblock';

import {Link} from 'react-router-dom';
import { HashRouter, Routes, Route} from 'react-router-dom';

function Gung(){
    let num=0;
    return(
        <>
            <div>
                <h2>{dataM.gogung[num].gung_Name}</h2>
                <div>
                    <p>
                        <span><Link to="/gung">갤러리보기</Link></span>
                        <span>목록보기</span>
                    </p>
                    <select>
                        <option>오름차순</option>
                        <option>내림차순</option>
                        <option>인기순</option>
                    </select>
                </div>
            </div>
            <div>
                <HashRouter>
                    <Routes>
                        <Route path="/gung" element={<Gblock/>}/>
                        <Route path="/gung" element={<Gblock/>}/>
                    </Routes>
                </HashRouter>

                <Gblock/>
            </div>

        </>
    );
}
export default Gung;
